package com.dest.basicsOfProgramming.variables;

public class WrapperClasses {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Byte b = new Byte((byte)113);
		System.out.println(b);
		Short s = new Short((short)20000);
		System.out.println(s);
		Integer i = new Integer(26452);
		System.out.println(i);
		Long l = new Long(86399569);
		System.out.println(l);
		
		Float f = new Float(2345.65f);
		System.out.println(f);
		Double d = new Double(4356.7895);
		System.out.println(d);
		
		Character c = new Character('p');
		System.out.println(c);
		String str = new String("prassu");
		System.out.println(str);
		
		Boolean b1 = new Boolean(true);
		System.out.println(b1);
		
		

	}

}
